import "./ExpenseFilter.css";

const ExpenseFilter = () => {
  return (
    <div className="expenses-filter">
      <label className="expenses-filter__control">Filter Year</label>
      <select>
        <option>2022</option>
        <option>2021</option>
        <option>2020</option>
        <option>2019</option>
      </select>
    </div>
  );
};

export default ExpenseFilter;
